def getda(url):
    r = requests.get(url)
    soup = BeautifulSoup(r.text)
    cord=soup.select("#extra_fields_description")[0].text
    img=soup.find("img", {"class": "main_image"})['src']
    name=soup.find("div", {"class": "b1c-name"}).text
    text=""
    try:
        text=soup.find("div", {"class": "jshop_prod_description"}).find("div").find("div").text
    except:
        pass
    f = open("data.txt", "a")
    f.write('{name: "'+name+'",pos: {lat: '+cord.split(",")[0]+', lng: '+cord.split(",")[1]+'},img: "'+img+'",text: "'+text+'"},\n')
    f.close()

for i in url:
    getda(url[i])
    k=k+1
    print(str(k)+"/"+str(len(url)))